INSERT INTO `admin_data` (`id`, `username`, `password`, `jobrole`, `job_desc`, `questions`, `answers`) VALUES
(1, 'admin', '1', 'JAVA developer', 'Job brief\r\n\r\nWe are looking for a Senior Web Developer to build and maintain functional web pages and applications.\r\nSenior Web Developer responsibilities include leading a team of junior developers, refining website specifications and resolving technical issues. To be successful in this role, you should have extensive experience building web pages from scratch and in-depth knowledge of at least one of the following programming languages: Javascript, Ruby or PHP.\r\nUltimately, you will ensure our web pages are up and running and cover both internal and customer needs.\r\nResponsibilities\r\nIdentify user and system requirements for new websites and applications\r\nPrioritize software development projects, set timelines and assign tasks to team members\r\nCreate wireframes to decide on layout\r\nWrite or review code for various applications\r\nRun functionality testings and debug code\r\nOversee junior web developers and evaluate their performance\r\nLiaise with designers to decide on UI/UX elements (like graphics and navigation buttons)\r\nEnsure our software documentation is up-to-date\r\nCollaborate with mobile developers to build mobile-responsive websites\r\nRequirements\r\nWork experience as a Senior Web Developer\r\nExpertise in at least one programming language, preferably Javascript, Ruby or PHP\r\nSolid knowledge of HTML/CSS\r\nExperience with mockup and UI prototyping tools\r\nUnderstanding of security practices\r\nFamiliarity with network diagnostics tools\r\nTeam management skills\r\n\r\nBSc/MSc in Computer Science or relevant field\r\n', '[\"Explain the main features of Java.\", \"What is the difference between an abstract class and an interface?\", \"What is the significance of the static keyword in Java?\", \"Explain the purpose of the final keyword.\", \"What is the difference between == and .equals() in Java?\", \"What is a constructor?\", \"What is the difference between ArrayList and LinkedList?\", \"How does exception handling work in Java?\", \"What is the difference between throw and throws in Java?\", \"Explain the concept of multithreading in Java?\", \"what is java What is the difference between ArrayList and LinkedList? What is the difference between ArrayList and LinkedList?What is the difference between ArrayList and LinkedList?What is the difference between ArrayList and LinkedList?What is the difference between ArrayList and LinkedList?\"]', '[\"Object-oriented, platform-independent, simple, distributed, multithreading, robust, and secure.\", \"Abstract class can have both abstract and concrete methods; interface can only have abstract methods.\", \"static is used for class-level variables and methods, belonging to the class rather than instances.\", \"final makes a variable constant, a method cannot be overridden, and a class cannot be extended.\", \"== compares object references, while .equals() compares object content.\", \"A constructor is a special method used to initialize objects, with the same name as the class and no return type.\", \"ArrayList provides fast random access using an array, while LinkedList is better for frequent insertion and deletion operations.\", \"Java uses try, catch, and finally blocks to handle exceptions, which represent abnormal conditions or errors.\", \"throw is used to explicitly throw an exception, while throws is used in method declarations to indicate potential exceptions.\", \"Multithreading is the concurrent execution of two or more threads, where threads are lightweight processes sharing the same memory space.\", \"Java is a Object oriented programing language.\"]'),
(2, 'rossy', 'rossy', 'Packaged App Development Associate', 'Packaged App Development Associate\n\nCTC- 4.6 LPA\n\nDeveloping, designing and maintaining technologies that improve the way our clients and the world works. Working in challenging and dynamic environments, they use their versatility to create and support technology solutions that meet client requirements from analysis to implementation.\n\nDesign, build, test, assemble, and configure application using business requirements\nUnderstand business drivers that will impact performance and deliver software to those expectations\nBake technology trends into solutions; Participate in the development of automation solutions, new functionality and technologies and integrate them in existing solutions\nAptitude to learn, Good analytical and problem-solving skills and proficient in verbal and communication skills\nDeliver code to time and quality expectations and participate in peer reviews\nTake ownership of the successful implementation of the solution\nEligibility:\nAll streams/branches of B.E/B.Tech/M.E/M.Tech, MCA and M.Sc. (CSE, IT only), 2022, 2023 and 2024 Passout only.\nNo active backlogs during application and/or during onboarding.\nCandidate should have completed the relevant degree (eligible for this job role) in the stipulated duration of the degree. Hence, there should be no gaps during the course of your degree.\n          E.g: candidate must complete the 4-year B. Tech course in 4 years.\nCandidate should not have appeared for Accenture Recruitment assessment/interview process in the last three months.\nCandidate should not have more than 11 months of experience\nCandidates must be eligible to work in India either by citizenship/ have relevant work permit documents. \nPlease note that Bhutan and Nepal nationals can work in India without a need for obtaining a work visa.All other foreign nationals require work visa or an Overseas Citizenship of India (OCI) or Person of Indian Origin (PIO) card to work in India.', NULL, NULL),
(3, 'test', 'test', ' Associate Software Engineer', 'Job Description\r\nThe Associate Software Engineer will be part of the software development team and participates in all phases of the software development project life cycle, includes analysis, design, develop code, test business software applications and project implementation.\r\n\r\nResponsibilities:\r\n• Assist in defining and reviewing requirements and use cases for the application.\r\n• Design the application to meet the business process design and application requirements.\r\n• Configure, build, and test the application or technical architecture components.\r\n• Participate in transitioning the designs to the developers, code reviews and transitions of the application or technical architecture components to the testers.\r\n• Fix any defects and performance problems discovered during testing\r\n• Create technical and functional/end-user operational documentation for the software or system.', NULL, NULL);

